  ModalTitle,
  ModalHeader,
  Div,
} from '../EditProfileModal/EditProfileModal.styled';

const AddBoardModal = ({ closeModal }) => {
  return (
    <Div>
      <ModalContainer onClose={closeModal}>
        <ModalHeader>
          <ModalTitle>New board</ModalTitle>
          <CloseModalCross /> {/* Викликайте як функцію handleCloseModal */}
        </ModalHeader>
        <AddBoard />
      </ModalContainer>
    </Div>
  );
};

export default AddBoardModal;
